import React, { useState, useEffect } from 'react';
import { useSearchParams } from 'react-router-dom';
import Navbar from '../components/Navbar';
import PropertyCard from '../components/PropertyCard';
import { useTheme } from '../contexts/ThemeContext';

const Rent = () => {
  const [properties, setProperties] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [searchParams] = useSearchParams();
  const { isDarkMode } = useTheme();
  
  // Extract filters from URL query params
  const city = searchParams.get('city') || '';
  
  useEffect(() => {
    // Mock data loading
    setTimeout(() => {
      const mockProperties = Array.from({ length: 9 }, (_, i) => ({
        _id: `rent-property-${i + 1}`,
        title: `Beautiful Rental in ${city || 'New York'}`,
        price: 1200 + (i * 200),
        listingType: 'rent',
        propertyType: ['apartment', 'house', 'penthouse', 'studio'][i % 4],
        bedrooms: 1 + (i % 4),
        bathrooms: 1 + (i % 3),
        location: {
          city: city || 'New York',
        },
        images: [`https://via.placeholder.com/800x600/F8FAFC/E2E8F0?text=Rental+${i + 1}`],
      }));
      
      setProperties(mockProperties);
      setLoading(false);
    }, 500);
  }, [city]);
  
  return (
    <div className="min-h-screen bg-theme-primary text-theme-primary">
      <Navbar />
      
      <main className="container mx-auto px-4 py-8">
        <h1 className="text-3xl font-bold mb-4">Properties for Rent</h1>
        {city && <p className="mb-6">Location: {city}</p>}
        
        {loading ? (
          <div className="grid grid-cols-1 md:grid-cols-3 gap-6">
            {Array.from({ length: 9 }).map((_, i) => (
              <div 
                key={i} 
                className="h-80 rounded-lg animate-pulse" 
                style={{ backgroundColor: isDarkMode ? '#374151' : '#E5E7EB' }}
              />
            ))}
          </div>
        ) : (
          <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6">
            {properties.map(property => (
              <PropertyCard key={property._id} property={property} />
            ))}
          </div>
        )}
      </main>
      
      <footer className="bg-gray-800 text-white py-12 mt-auto">
        <div className="container mx-auto px-4 text-center">
          <p className="text-gray-400">Â© {new Date().getFullYear()} MoveIN. All rights reserved.</p>
        </div>
      </footer>
    </div>
  );
};

export default Rent;
